%[text] % Experiment 1: Sampling Theorem Demonstration
clear all;
close all;
clc;

% Time and signal definition
tot = 1;
td = 0.002;
t = 0:td:tot;
x = sin(2*pi*t) - sin(6*pi*t);

% Plot the input message signal
figure; %[output:742dd80e]
plot(t, x, 'LineWidth', 2); %[output:742dd80e]
xlabel('Time (s)'); %[output:742dd80e]
ylabel('Amplitude'); %[output:742dd80e]
title('Input Message Signal'); %[output:742dd80e]
grid on; %[output:742dd80e]

% Frequency analysis of the input signal
L = length(x);
Lfft = 2^nextpow2(L);
fmax = 1/(2*td);
Faxis = linspace(-fmax, fmax, Lfft);
Xfft = fftshift(fft(x, Lfft));
figure; %[output:9c28ebfc]
plot(Faxis, abs(Xfft)); %[output:9c28ebfc]
xlabel('Frequency (Hz)'); %[output:9c28ebfc]
ylabel('Magnitude'); %[output:9c28ebfc]
title('Spectrum of Input Message Signal'); %[output:9c28ebfc]
grid on; %[output:9c28ebfc]

% Sampling the signal
ts = 0.02;
n = 0:ts:tot;
x_sampled = sin(2*pi*n) - sin(6*pi*n);

% Plot the sampled signal
figure; %[output:22fa022c]
stem(n, x_sampled, 'LineWidth', 2); %[output:22fa022c]
xlabel('Time (s)'); %[output:22fa022c]
ylabel('Amplitude'); %[output:22fa022c]
title('Sampled Signal'); %[output:22fa022c]
grid on; %[output:22fa022c]

% Upsample for spectrum analysis
x_sampled_upsampled = upsample(x_sampled, round(ts/td));
Lffu = 2^nextpow2(length(x_sampled_upsampled));
fmaxu = 1/(2*td);
Faxisu = linspace(-fmaxu, fmaxu, Lffu);
Xfftu = fftshift(fft(x_sampled_upsampled, Lffu));
figure; %[output:433627a2]
plot(Faxisu, abs(Xfftu)); %[output:433627a2]
xlabel('Frequency (Hz)'); %[output:433627a2]
ylabel('Magnitude'); %[output:433627a2]
title('Spectrum of Sampled Signal'); %[output:433627a2]
grid on; %[output:433627a2]

